use actix_multipart::form::{tempfile::TempFile, text::Text, MultipartForm};
use actix_web::{post, App, HttpServer, Responder}; #[derive(Debug, MultipartForm)]
struct UploadForm { #[multipart(limit = "100MB")] file: TempFile, desc: Text<String>,
} #[post("/upload")]
pub async fn upload(MultipartForm(form): MultipartForm<UploadForm>) -> impl Responder { format!( "Uploaded file {:?}, with size: {}, description: {:?}", form.file.file_name, form.file.size, form.desc )
} #[actix_web::main]
async fn main() -> std::io::Result<()> { HttpServer::new(move || App::new().service(upload)) .bind(("127.0.0.1", 8080))? .run() .await
}
